import React from "react";

const MovieList = () => {
  return (
    <div>
      Welcome to Movie Land
      <Grid container spacing={4}>
        <Grid item xs={4}>
          <TextField
            type="text"
            id="outlined-basic"
            label="Search"
            variant="outlined"
          />
        </Grid>
      </Grid>
    </div>
  );
};

export default MovieList;
